import { Grid } from "@material-ui/core";
import React, { Component } from "react";
import rocket from '../../assets/astronaut.png'
import './styles/rocket.css'
import csharp from '../../assets/csharp-logo.svg'
import ImageParallax from "../ImageParallax";

class Astronaut extends Component {
  render() {
    return (
      <Grid item xs={6} className="astronaut">

        <Grid item xs={10} style={{backgroundColor: 'blue'}}>
          <img src={rocket} className="rocket-img" alt="" />          
        </Grid>

        <ImageParallax offset={0.65} speed={0.3} image={csharp} css="csharp-logo" />

      </Grid>
    )
  }
}

export default Astronaut
